import { Component, OnInit } from '@angular/core';
import { MatTableDataSource } from '@angular/material/table';
import { ActivatedRoute, Router } from '@angular/router';
import { AuthService } from 'src/app/services/auth.service';

@Component({
  selector: 'app-url-info',
  templateUrl: './url-info.component.html',
  styleUrls: ['./url-info.component.css']
})
export class UrlInfoComponent implements OnInit {
  user: any;
  displayedColumns: string[] = ['Id', 'LongUrl', 'Shortened Url', 'Date of creation', 'Owner id'];
  dataSource: any;

constructor(private auth: AuthService, 
  private activatedRoute: ActivatedRoute,
  private router: Router) {}

  ngOnInit(): void {
    this.activatedRoute.queryParams.subscribe((res:any) => {
      this.user = JSON.parse(res.data);
      this.dataSource = new MatTableDataSource([this.user]);
    });
  }

  isAdmin(): boolean{
    return this.auth.isAdmin();
  }

  logOut() {
    this.auth.signOut();
  }

  isVisible(urlObj: any) {
    if (this.isAuthorized()) {
      return this.isAdmin();
    }
    return false;
  }

  isAuthorized(): boolean {
    return this.auth.isLoggedIn();
  }

  logInRedirect() {
    this.router.navigate(['login']);
  }

  toAbout(){
    this.router.navigate(['about']);;
  }
}
<div class="outer">
  <div class="container-home">
    <nav class="mb-2 pt-2">
      <ul class="nav">
        <li class="">
          <button class="btn btn-primary" (click)="toAbout()">About</button>
        </li>
        <li class="nav-item d-inline-flex">
          <div *ngIf="isAuthorized(); then signoutButton else loginButton"></div>

          <ng-template #loginButton>
            <button (click)="logInRedirect()" class="btn btn-primary">Log in</button>
          </ng-template>

          <ng-template #signoutButton>
            <button (click)="logOut()" class="btn btn-primary">Sign out</button>
          </ng-template>

        </li>
      </ul>
    </nav>

    <table mat-table [dataSource]="dataSource" class="mat-elevation-z8">

        <ng-container matColumnDef="Id">
          <th mat-header-cell *matHeaderCellDef> Id </th>
          <td mat-cell *matCellDef="let element"> {{element.id}} </td>
        </ng-container>

        <ng-container matColumnDef="LongUrl">
          <th mat-header-cell *matHeaderCellDef> LongUrl </th>
          <td mat-cell *matCellDef="let element"> {{element.longUrl}} </td>
        </ng-container>

        <ng-container matColumnDef="Shortened Url">
          <th mat-header-cell *matHeaderCellDef> Shortened Url</th>
          <td mat-cell *matCellDef="let element"> {{element.shortened}} </td>
        </ng-container>

        <ng-container matColumnDef="Date of creation">
          <th mat-header-cell *matHeaderCellDef> Date of creation </th>
          <td mat-cell *matCellDef="let element"> {{element.dateOfCreation}} </td>
        </ng-container>

        <ng-container matColumnDef="Owner id">
          <th mat-header-cell *matHeaderCellDef> Owner id</th>
          <td mat-cell *matCellDef="let element"> {{element.userId}} </td>
        </ng-container>

        <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
        <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
      </table>
  </div>
</div>
